import React, { Fragment } from "react";

import LogoName from "../components/logoName";
import LogoImage from "./logoImage";
const image = "/images/giftu.png";

const Header = () => {
	return (
		<Fragment>
			<LogoName src={image} alt="logo imagen" />
			<LogoImage />
		</Fragment>
	);
};

export default Header;
